MUSIC_DATA_CACHE["LOVE★BEAM (orange summer mix)-MANIAC-"]={org_level="None",lr2_bmsid="107320",title="LOVE★BEAM (orange summer mix)-MANIAC-",md5="fda9cbb7565cc7ee9887aaabc77f293f",tables={{video3="",submission="",video1="",comment="LOVE☆BEAM ★15と★★鷺　※ちょっとした読み物付き！",table_name="高難易度BMS差分Uploader",folder="2011/08",proposer="",name_diff="love♂beam.zip",md5="fda9cbb7565cc7ee9887aaabc77f293f",level="2011/08",url="http://manbow.nothing.sh/event/event.cgi?action=More_def&num=3&event=33",video2="",reg_date="",add_date="",url_diff="http://www.ribbit.xyz/bms/mirror/uploader/src/up2168.zip",detail={last_update="2016/09/30",name="高難易度BMS差分Uploader",original_url="http://www.ribbit.xyz/bms/tables/bmsuploader.html",symbol="㊤",data_url="data.json",folder_order={},level_order={},},},{video3="",submission="",video1="",comment="汎用up2168.zip\n\n【LOVE♂BEAMの由来】\nBMSクラスターに扮したBCNらがBTNKの車に追突 \n　↓ \n「ゴリラのまねしろよ」「発狂皆伝受かるんだよ」「受かれば返していただけるんですか？」 \n「何ゴリラのくせにお前服着てるんだよ」「早くしろよ」などの会話を経て全裸に。 \n　↓ \n「ウホウホ泣いてみろ」「まわってみろ」「よぉし、全押しだ」の命令にゴリラを演じるも \n「なんかゴリラっぽくねぇなあ」「なんか(地力が)たんねえよなぁ」ということで発狂皆伝を受け始める。 \n　↓ \n　AZLのソフランにゲージを削られ、「汚ない運指だなぁ」などと罵られる。縦連打に指が反応できず。 \n「お前初めてかゴリフルは、力抜いて連打しろよ」と後輩の目前でいじられ、長い尻尾をつけられる。 \n　↓ \n「落としてやれよ」と命令された後輩(PLSM)の序盤で「アッー　アッー！」と悶える \n　↓ \nBTNKに局部を見せながら２人の後輩に尻の穴を見せる。「難しい！」と悶えながら \n男性自身を勃起(^ω^)させる。このあと、後輩(HTN)がコンドームをつけ、BCNに背後から挿入。 \n「ウホッ！」と唸るも、直後から「アッ、アッ、アッ、アッ！」とBCNは勃起(^ω^)させながら声をあげる。 \n　↓ \nプラズマも終わりリトハが始まる。ゲージを削られるばかりだったBCNが一転、攻勢に出て、回復地帯でゲージを増やし始める。 \n小刻みにキーを叩きながら「ｳｶﾞﾙッ(受かるっ)！ｳｶﾞﾙｯ！アッー！、アッー！」 と叫んで、BCNもリトハのデニムに勢い良く届け　ら・ぶ☆び・い・むー♂♪(ｶﾞｼｬｰﾝ)\n\nhttp://www.dream-pro.info/~lavalse/LR2IR/search.cgi?mode=ranking&bmsid=175330\n音抜けがあったため修正",table_name="高難易度差分案内所",folder="",proposer="",name_diff="obj:BAECON",md5="fda9cbb7565cc7ee9887aaabc77f293f",level="14",url="http://manbow.nothing.sh/event/event.cgi?action=More_def&num=3&event=33",video2="",reg_date="",add_date="",url_diff="http://absolute.pv.land.to/uploader/src/up2168.zip",detail={last_update="2015/11/01",name="高難易度差分案内所",original_url="http://uetnosu